import './App.css';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Header from "./components/Header";
import Tree from './components/Tree/Tree';

function App() {
  return (
    <div className="App">
      <Router>
      <Header/>
        <Routes>
          <Route path="/" element={<Tree data={"festivals"} />} />
          {/* <Route exact path="/:image" element={<Tree/>} /> */}
        </Routes>
      </Router>
    </div>
  );
}
export default App;
